public class DivisibleBy2or3
{
    private static boolean divCheck(int n)
    {
        if(n % 2 == 0 || n % 3 == 0)
        {
          return true;
        }
        return false;
    }

    public static void main(String[] args)
    {
        int[] arr = {6,7,17,3,2,9,1,5};
        for (int i = 0; i < arr.length; i++)
        {
            if(divCheck(arr[i]))
            {
                int temp = arr[0];
                arr[0] = arr[i];
                arr[i] = temp;
            }
        }
        for (int t = 0; t < arr.length; t++)
        {
            System.out.print((arr[t]) + " ");
        }
    }
}

